public class CpioArchiveOutputStream extends org.apache.commons.compress.archivers.ArchiveOutputStream implements org.apache.commons.compress.archivers.cpio.CpioConstants {
    private org.apache.commons.compress.archivers.cpio.CpioArchiveEntry entry;

    private boolean closed = false;

    private boolean finished;

    private final short entryFormat;

    private final java.util.HashMap<java.lang.String, org.apache.commons.compress.archivers.cpio.CpioArchiveEntry> names = new java.util.HashMap<java.lang.String, org.apache.commons.compress.archivers.cpio.CpioArchiveEntry>();

    private long crc = 0;

    private long written;

    private final java.io.OutputStream out;

    private final int blockSize;

    private long nextArtificalDeviceAndInode = 1;

    private final org.apache.commons.compress.archivers.zip.ZipEncoding zipEncoding;

    final java.lang.String encoding;

    public CpioArchiveOutputStream(final java.io.OutputStream out, final short format) {
        this(out, format, org.apache.commons.compress.archivers.cpio.CpioConstants.BLOCK_SIZE, org.apache.commons.compress.utils.CharsetNames.US_ASCII);
    }

    public CpioArchiveOutputStream(final java.io.OutputStream out, final short format, final int blockSize) {
        this(out, format, blockSize, org.apache.commons.compress.utils.CharsetNames.US_ASCII);
    }

    public CpioArchiveOutputStream(final java.io.OutputStream out, final short format, final int blockSize, final java.lang.String encoding) {
        this.out = out;
        switch (format) {
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW :
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW_CRC :
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_OLD_ASCII :
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_OLD_BINARY :
                break;
            default :
                throw new java.lang.IllegalArgumentException("Unknown format: " + format);
        }
        this.entryFormat = format;
        this.blockSize = blockSize;
        this.encoding = encoding;
        this.zipEncoding = org.apache.commons.compress.archivers.zip.ZipEncodingHelper.getZipEncoding(encoding);
    }

    public CpioArchiveOutputStream(final java.io.OutputStream out) {
        this(out, org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW);
    }

    public CpioArchiveOutputStream(final java.io.OutputStream out, java.lang.String encoding) {
        this(out, org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW, org.apache.commons.compress.archivers.cpio.CpioConstants.BLOCK_SIZE, encoding);
    }

    private void ensureOpen() throws java.io.IOException {
        if (this.closed) {
            throw new java.io.IOException("Stream closed");
        }
    }

    @java.lang.Override
    public void putArchiveEntry(org.apache.commons.compress.archivers.ArchiveEntry entry) throws java.io.IOException {
        if (finished) {
            throw new java.io.IOException("Stream has already been finished");
        }
        org.apache.commons.compress.archivers.cpio.CpioArchiveEntry e = ((org.apache.commons.compress.archivers.cpio.CpioArchiveEntry) (entry));
        ensureOpen();
        if (this.entry != null) {
            closeArchiveEntry();
        }
        if (e.getTime() == (-1)) {
            e.setTime(java.lang.System.currentTimeMillis() / 1000);
        }
        final short format = e.getFormat();
        if (format != this.entryFormat) {
            throw new java.io.IOException((("Header format: " + format) + " does not match existing format: ") + this.entryFormat);
        }
        if (this.names.put(e.getName(), e) != null) {
            throw new java.io.IOException("duplicate entry: " + e.getName());
        }
        writeHeader(e);
        this.entry = e;
        this.written = 0;
    }

    private void writeHeader(final org.apache.commons.compress.archivers.cpio.CpioArchiveEntry e) throws java.io.IOException {
        switch (e.getFormat()) {
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW :
                out.write(org.apache.commons.compress.utils.ArchiveUtils.toAsciiBytes(org.apache.commons.compress.archivers.cpio.CpioConstants.MAGIC_NEW));
                count(6);
                writeNewEntry(e);
                break;
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW_CRC :
                out.write(org.apache.commons.compress.utils.ArchiveUtils.toAsciiBytes(org.apache.commons.compress.archivers.cpio.CpioConstants.MAGIC_NEW_CRC));
                count(6);
                writeNewEntry(e);
                break;
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_OLD_ASCII :
                out.write(org.apache.commons.compress.utils.ArchiveUtils.toAsciiBytes(org.apache.commons.compress.archivers.cpio.CpioConstants.MAGIC_OLD_ASCII));
                count(6);
                writeOldAsciiEntry(e);
                break;
            case org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_OLD_BINARY :
                boolean swapHalfWord = true;
                writeBinaryLong(org.apache.commons.compress.archivers.cpio.CpioConstants.MAGIC_OLD_BINARY, 2, swapHalfWord);
                writeOldBinaryEntry(e, swapHalfWord);
                break;
            default :
                throw new java.io.IOException("unknown format " + e.getFormat());
        }
    }

    private void writeNewEntry(final org.apache.commons.compress.archivers.cpio.CpioArchiveEntry entry) throws java.io.IOException {
        long inode = entry.getInode();
        long devMin = entry.getDeviceMin();
        if (org.apache.commons.compress.archivers.cpio.CpioConstants.CPIO_TRAILER.equals(entry.getName())) {
            inode = devMin = 0;
        } else if ((inode == 0) && (devMin == 0)) {
            inode = nextArtificalDeviceAndInode & 0xffffffff;
            devMin = ((nextArtificalDeviceAndInode++) >> 32) & 0xffffffff;
        } else {
            nextArtificalDeviceAndInode = java.lang.Math.max(nextArtificalDeviceAndInode, inode + (0x100000000L * devMin)) + 1;
        }
        writeAsciiLong(inode, 8, 16);
        writeAsciiLong(entry.getMode(), 8, 16);
        writeAsciiLong(entry.getUID(), 8, 16);
        writeAsciiLong(entry.getGID(), 8, 16);
        writeAsciiLong(entry.getNumberOfLinks(), 8, 16);
        writeAsciiLong(entry.getTime(), 8, 16);
        writeAsciiLong(entry.getSize(), 8, 16);
        writeAsciiLong(entry.getDeviceMaj(), 8, 16);
        writeAsciiLong(devMin, 8, 16);
        writeAsciiLong(entry.getRemoteDeviceMaj(), 8, 16);
        writeAsciiLong(entry.getRemoteDeviceMin(), 8, 16);
        writeAsciiLong(entry.getName().length() + 1, 8, 16);
        writeAsciiLong(entry.getChksum(), 8, 16);
        writeCString(entry.getName());
        pad(entry.getHeaderPadCount());
    }

    private void writeOldAsciiEntry(final org.apache.commons.compress.archivers.cpio.CpioArchiveEntry entry) throws java.io.IOException {
        long inode = entry.getInode();
        long device = entry.getDevice();
        if (org.apache.commons.compress.archivers.cpio.CpioConstants.CPIO_TRAILER.equals(entry.getName())) {
            inode = device = 0;
        } else if ((inode == 0) && (device == 0)) {
            inode = nextArtificalDeviceAndInode & 0777777;
            device = ((nextArtificalDeviceAndInode++) >> 18) & 0777777;
        } else {
            nextArtificalDeviceAndInode = java.lang.Math.max(nextArtificalDeviceAndInode, inode + (01000000 * device)) + 1;
        }
        writeAsciiLong(device, 6, 8);
        writeAsciiLong(inode, 6, 8);
        writeAsciiLong(entry.getMode(), 6, 8);
        writeAsciiLong(entry.getUID(), 6, 8);
        writeAsciiLong(entry.getGID(), 6, 8);
        writeAsciiLong(entry.getNumberOfLinks(), 6, 8);
        writeAsciiLong(entry.getRemoteDevice(), 6, 8);
        writeAsciiLong(entry.getTime(), 11, 8);
        writeAsciiLong(entry.getName().length() + 1, 6, 8);
        writeAsciiLong(entry.getSize(), 11, 8);
        writeCString(entry.getName());
    }

    private void writeOldBinaryEntry(final org.apache.commons.compress.archivers.cpio.CpioArchiveEntry entry, final boolean swapHalfWord) throws java.io.IOException {
        long inode = entry.getInode();
        long device = entry.getDevice();
        if (org.apache.commons.compress.archivers.cpio.CpioConstants.CPIO_TRAILER.equals(entry.getName())) {
            inode = device = 0;
        } else if ((inode == 0) && (device == 0)) {
            inode = nextArtificalDeviceAndInode & 0xffff;
            device = ((nextArtificalDeviceAndInode++) >> 16) & 0xffff;
        } else {
            nextArtificalDeviceAndInode = java.lang.Math.max(nextArtificalDeviceAndInode, inode + (0x10000 * device)) + 1;
        }
        writeBinaryLong(device, 2, swapHalfWord);
        writeBinaryLong(inode, 2, swapHalfWord);
        writeBinaryLong(entry.getMode(), 2, swapHalfWord);
        writeBinaryLong(entry.getUID(), 2, swapHalfWord);
        writeBinaryLong(entry.getGID(), 2, swapHalfWord);
        writeBinaryLong(entry.getNumberOfLinks(), 2, swapHalfWord);
        writeBinaryLong(entry.getRemoteDevice(), 2, swapHalfWord);
        writeBinaryLong(entry.getTime(), 4, swapHalfWord);
        writeBinaryLong(entry.getName().length() + 1, 2, swapHalfWord);
        writeBinaryLong(entry.getSize(), 4, swapHalfWord);
        writeCString(entry.getName());
        pad(entry.getHeaderPadCount());
    }

    @java.lang.Override
    public void closeArchiveEntry() throws java.io.IOException {
        if (finished) {
            throw new java.io.IOException("Stream has already been finished");
        }
        ensureOpen();
        if (entry == null) {
            throw new java.io.IOException("Trying to close non-existent entry");
        }
        if (this.entry.getSize() != this.written) {
            throw new java.io.IOException(((("invalid entry size (expected " + this.entry.getSize()) + " but got ") + this.written) + " bytes)");
        }
        pad(this.entry.getDataPadCount());
        if ((this.entry.getFormat() == org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW_CRC) && (this.crc != this.entry.getChksum())) {
            throw new java.io.IOException("CRC Error");
        }
        this.entry = null;
        this.crc = 0;
        this.written = 0;
    }

    @java.lang.Override
    public void write(final byte[] b, final int off, final int len) throws java.io.IOException {
        ensureOpen();
        if (((off < 0) || (len < 0)) || (off > (b.length - len))) {
            throw new java.lang.IndexOutOfBoundsException();
        } else if (len == 0) {
            return;
        }
        if (this.entry == null) {
            throw new java.io.IOException("no current CPIO entry");
        }
        if ((this.written + len) > this.entry.getSize()) {
            throw new java.io.IOException("attempt to write past end of STORED entry");
        }
        out.write(b, off, len);
        this.written += len;
        if (this.entry.getFormat() == org.apache.commons.compress.archivers.cpio.CpioConstants.FORMAT_NEW_CRC) {
            for (int pos = 0; pos < len; pos++) {
                this.crc += b[pos] & 0xff;
            }
        }
        count(len);
    }

    @java.lang.Override
    public void finish() throws java.io.IOException {
        ensureOpen();
        if (finished) {
            throw new java.io.IOException("This archive has already been finished");
        }
        if (this.entry != null) {
            throw new java.io.IOException("This archive contains unclosed entries.");
        }
        this.entry = new org.apache.commons.compress.archivers.cpio.CpioArchiveEntry(this.entryFormat);
        this.entry.setName(org.apache.commons.compress.archivers.cpio.CpioConstants.CPIO_TRAILER);
        this.entry.setNumberOfLinks(1);
        writeHeader(this.entry);
        closeArchiveEntry();
        int lengthOfLastBlock = ((int) (getBytesWritten() % blockSize));
        if (lengthOfLastBlock != 0) {
            pad(blockSize - lengthOfLastBlock);
        }
        finished = true;
    }

    @java.lang.Override
    public void close() throws java.io.IOException {
        if (!finished) {
            finish();
        }
        if (!this.closed) {
            out.close();
            this.closed = true;
        }
    }

    private void pad(int count) throws java.io.IOException {
        if (count > 0) {
            byte[] buff = new byte[count];
            out.write(buff);
            count(count);
        }
    }

    private void writeBinaryLong(final long number, final int length, final boolean swapHalfWord) throws java.io.IOException {
        byte[] tmp = org.apache.commons.compress.archivers.cpio.CpioUtil.long2byteArray(number, length, swapHalfWord);
        out.write(tmp);
        count(tmp.length);
    }

    private void writeAsciiLong(final long number, final int length, final int radix) throws java.io.IOException {
        java.lang.StringBuilder tmp = new java.lang.StringBuilder();
        java.lang.String tmpStr;
        if (radix == 16) {
            tmp.append(java.lang.Long.toHexString(number));
        } else if (radix == 8) {
            tmp.append(java.lang.Long.toOctalString(number));
        } else {
            tmp.append(java.lang.Long.toString(number));
        }
        if (tmp.length() <= length) {
            long insertLength = length - tmp.length();
            for (int pos = 0; pos < insertLength; pos++) {
                tmp.insert(0, "0");
            }
            tmpStr = tmp.toString();
        } else {
            tmpStr = tmp.substring(tmp.length() - length);
        }
        byte[] b = org.apache.commons.compress.utils.ArchiveUtils.toAsciiBytes(tmpStr);
        out.write(b);
        count(b.length);
    }

    private void writeCString(final java.lang.String str) throws java.io.IOException {
        java.nio.ByteBuffer buf = zipEncoding.encode(str);
        final int len = buf.limit() - buf.position();
        out.write(buf.array(), buf.arrayOffset(), len);
        out.write('\u0000');
        count(len + 1);
    }

    @java.lang.Override
    public org.apache.commons.compress.archivers.ArchiveEntry createArchiveEntry(java.io.File inputFile, java.lang.String entryName) throws java.io.IOException {
        if (finished) {
            throw new java.io.IOException("Stream has already been finished");
        }
        return new org.apache.commons.compress.archivers.cpio.CpioArchiveEntry(inputFile, entryName);
    }
}

